import React, { useEffect } from "react";

const Place = ({id}) => {
    useEffect(() => {
        const fetchPlaceData = async () => {
            try {
                setLoading(true);
                const response = await axios.get(`/api/places/${id}`); // 적절한 API 엔드포인트로 수정
                setPlaceData(response.data);
            } catch (err) {
                setError(err.message);
            } finally {
                setLoading(false);
            }
        };

        if (id) {
            fetchPlaceData();
        }
    }, [id]);

